  <![if !mso]>
  <table cellpadding=0 cellspacing=0 width="100%">
   <tr>
    <td><![endif]>
    <div>
    <p class=MsoNormal><b><span lang=ES-CO style='font-size:14.0pt;line-height:
    105%;font-family:"Century Gothic",sans-serif'>Nombre: <span class=GramE>Diego<span
    style='mso-spacerun:yes'>  </span>Sánchez</span><br>
    Edad: 25 años<br>
    País: México<br>
    Rol: <span class=SpellE>Fragger</span><o:p></o:p></span></b></p>
    <p class=MsoNormal><b><span lang=ES-CO style='font-size:14.0pt;line-height:
    105%;font-family:"Century Gothic",sans-serif'>Diego &quot;<span
    class=SpellE>GhostRider</span>&quot; Sánchez nació y creció en la Ciudad de
    México. Desde joven, mostró un talento natural para los videojuegos,
    especialmente en los <span class=SpellE>shooters</span>. Comenzó su carrera
    en los cibercafés locales, donde rápidamente se ganó una reputación por su
    precisión y habilidad táctica. El apodo &quot;<span class=SpellE>GhostRider</span>&quot;
    proviene de su estilo de juego sigiloso y mortal, donde parecía aparecer de
    la nada para eliminar a sus oponentes, dejando una estela de caos a su
    paso.<o:p></o:p></span></b></p>
    <p class=MsoNormal><b><span lang=ES-CO style='font-size:14.0pt;line-height:
    105%;font-family:"Century Gothic",sans-serif'>En 2022, después de ganar
    varios torneos y obtener reconocimiento internacional, <span class=SpellE>GhostRider</span>
    fue fichado por <span class=SpellE>DGti</span> <span class=SpellE>Esports</span>,
    un equipo de e-<span class=SpellE>sports</span> que buscaba fortalecer su
    presencia en <span class=SpellE>Warzone</span>. Su fichaje fue un
    movimiento estratégico para el equipo, que necesitaba un Slayer de élite
    para dominar en la escena competitiva. Desde entonces, <span class=SpellE>GhostRider</span>
    ha sido una pieza clave en el éxito del equipo, llevando a <span
    class=SpellE>DGti</span> <span class=SpellE>Esports</span> a nuevas alturas
    con su agresivo estilo de juego y su habilidad para liderar en momentos críticos.<o:p></o:p></span></b></p>
    <p class=MsoNormal><b><span lang=ES-CO style='font-size:14.0pt;line-height:
    105%;font-family:"Century Gothic",sans-serif'>Fecha de fichaje por <span
    class=SpellE>DGti</span> <span class=SpellE>Esports</span>: <span
    class=GramE>Marzo</span> de 2022<o:p></o:p></span></b></p>
    </div>

   </tr>

  <![endif]></v:textbox>

    <div>
    <p class=MsoNormal><b><span lang=ES-CO style='font-size:14.0pt;line-height:
    105%;font-family:"Century Gothic",sans-serif'>Nombre: <span class=GramE>Luis<span
    style='mso-spacerun:yes'>  </span>Rodríguez</span><br>
    Edad: 23 años<br>
    País: España<br>
    Rol: <span class=SpellE>Support</span> <o:p></o:p></span></b></p>
    <p class=MsoNormal><b><span lang=ES-CO style='font-size:14.0pt;line-height:
    105%;font-family:"Century Gothic",sans-serif'>Luis &quot;<span
    class=SpellE>ViperX</span>&quot; Rodríguez nació en Madrid, España, y desde
    muy pequeño mostró un gran interés por la estrategia y la competencia. A
    diferencia de otros jugadores que se centraban en la agresividad, <span
    class=SpellE>ViperX</span> se destacó por su enfoque cerebral y táctico.
    Desde sus primeros días como jugador, su habilidad para analizar el mapa y
    anticipar los movimientos del enemigo le permitió sobresalir como uno de
    los mejores jugadores de apoyo en la escena europea.<o:p></o:p></span></b></p>
    <p class=MsoNormal><b><span lang=ES-CO style='font-size:14.0pt;line-height:
    105%;font-family:"Century Gothic",sans-serif'>Desde que se unió a <span
    class=SpellE>DGti</span> <span class=SpellE>Esports</span>, <span
    class=SpellE>ViperX</span> ha sido el ancla del equipo, proporcionando la
    estabilidad y visión táctica necesarias para asegurar la victoria en los
    momentos más cruciales. Su capacidad para coordinar movimientos y mantener
    al equipo enfocado en sus objetivos ha sido esencial en los éxitos
    recientes de <span class=SpellE>DGti</span> <span class=SpellE>Esports</span>.<o:p></o:p></span></b></p>
    <p class=MsoNormal><b><span lang=ES-CO style='font-size:14.0pt;line-height:
    105%;font-family:"Century Gothic",sans-serif'>Fecha de fichaje por <span
    class=SpellE>DGti</span> <span class=SpellE>Esports</span>: <span
    class=GramE>Enero</span> de 2023<o:p></o:p></span></b></p>
    </div>

    <p class=MsoNormal><b><span lang=ES-CO style='font-size:14.0pt;line-height:
    105%;font-family:"Century Gothic",sans-serif'>Nombre: Javier Medina<br>
    Edad: 28 años<br>
    País: Argentina<br>
    Rol: Capitán (estratega y líder)<o:p></o:p></span></b></p>
    <p class=MsoNormal><b><span lang=ES-CO style='font-size:14.0pt;line-height:
    105%;font-family:"Century Gothic",sans-serif'>Javier &quot;<span
    class=SpellE>NightHawk</span>&quot; Medina, originario de Buenos Aires,
    Argentina, es el miembro más longevo y experimentado de <span class=SpellE>DGti</span>
    <span class=SpellE>Esports</span>. Con una pasión por los videojuegos desde
    una edad temprana, Javier comenzó su carrera en los <span class=SpellE>shooters</span>
    competitivos hace más de una década, mucho antes de que <span class=SpellE>Warzone</span>
    se convirtiera en el fenómeno global que es hoy.<o:p></o:p></span></b></p>
    <p class=MsoNormal><b><span lang=ES-CO style='font-size:14.0pt;line-height:
    105%;font-family:"Century Gothic",sans-serif'>A lo largo de los años,
    Javier ha sido fundamental para el crecimiento y éxito del equipo. Su
    experiencia y liderazgo han sido invaluables, y ha jugado un papel decisivo
    en el desarrollo de los nuevos talentos que se han unido al equipo. Bajo su
    dirección, <span class=SpellE>DGti</span> <span class=SpellE>Esports</span>
    ha logrado destacarse en la escena internacional de <span class=SpellE>Warzone</span>,
    convirtiéndose en un equipo temido y respetado.<o:p></o:p></span></b></p>
    <p class=MsoNormal><b><span lang=ES-CO style='font-size:14.0pt;line-height:
    105%;font-family:"Century Gothic",sans-serif'>Fecha de fichaje por <span
    class=SpellE>DGti</span> <span class=SpellE>Esports</span>: <span
    class=GramE>Octubre</span> de 2019<o:p></o:p></span></b></p>
    </div>

   </tr>
